import React from "react";
import styled from "styled-components";
import "./index.css";
import { FaUser, FaShoppingCart } from "react-icons/fa";

const Header = styled.div``;

const LogoNav = styled.nav`
    display: flex;
    justify-content: space-between;
    background-color: #f6f7fc;
    height: 75px;
`;

const Logo = styled.img`
  width: 220px;
  ${'' /* padding: 10px 0px 0px 10px; */}
  margin: 10px 0px 0px 25px;
  display: flex;
  justify-content: flex-start;
`;

const Nav = styled.nav``;

const DropButton = styled.button``;

const Dropdown = styled.button``;

const IndexComponent = () => {
  return (
    <>
      {/* write html tag as plain tag */}
      {/* &lt;h1&gt;hjhgkjhgk&lt;/h1&gt; */}
        <Header>
            <LogoNav>

                <div><Logo src="/images/materiallibrarylogo.png" alt="mlLogo"></Logo></div>
                {/* element 1 */}

                <div className="mycontent">
                    <div class="dropdown">
                        <button class="dropbtn">Portfolios</button>
                        <div class="dropdown-content">
                            <li>Create Portfolio</li>
                            <li>Company/Studio</li>
                            <li>Student/Professionals</li>
                            <li>Brand</li>
                            <li>College</li>

                        </div>
                    </div>
                
                {/* element 2 */}
                    <div class="dropdown">
                        <button class="dropbtn">Tutorials</button>
                        <div class="dropdown-content">
                            <li>Videos</li>
                            <li>Blogs</li>
                        </div>
                    </div>
                


                {/* element 3 */}
                
                    <div class="dropdown">
                        <button class="dropbtn">Jobs</button>
                        <div class="dropdown-content">
                            <li>Apply for Jobs</li>
                            <li>Post a Job</li>
                        </div>
                    </div>

                    <div className="iconPerson">
                        <div className="myinput"><input className="input-content" type="text" placeholder="Select Language" /></div>
                    </div>

                    <div className="iconsPerson">
                        <div className="iconbtn">
                            <FaUser />
                        </div>
                    </div>
                    <div className="iconsPerson">
                        <div className="iconbtn">
                            <FaShoppingCart />
                        </div>
                    </div>
                </div>
            </LogoNav>
            <Nav>
                <div className="morecontents">
                    <div class="moredropdown">
                        {/* <div className="hh"> */}
                            <button class="moredropbtn">Materials</button>
                        {/* </div> */}
                            {/* <div className="moredropelements"> */}
                                <div class="moredropdown-content">
                                    <li>Company</li>
                                    <li>Blogs</li>
                                {/* </div> */}
                            </div>
                        
                    </div>
                </div>

            </Nav>
      </Header>
    </>
  );
};

export default IndexComponent;
